          "nb" : "det beløp en upersonlig skattyter, personlig skattyter eller et dødsbo må betale til staten når skattesatsen fastsatt av Stortinget multipliseres med nettoformuen som overstiger en minstebeløp fastsatt av Stortinget"
        },
        "remark" : {
          "nb" : "Begrepet er vanskelig å definere generelt. Definisjonen er en omskriving av SSVs bestemmelser. Hva som er skattepliktig formue fremkommer av skatteloven kapittel 4, og det skattefri grunnbeløpet og skattesatsen fremkommer av SSV §§ 2-1 og 2-2.\nFormuesskatt til staten i inntektsåret 2017 betales av personlige skattytere, dødsbo og upersonlige skattytere. For personlige skattytere og dødsbo er formuesskatt til staten 0,15 % av den formuen (skattepliktig bruttoformue minus fradragsberettiget gjeld etter skatteloven kapittel 4) som overstiger 1.480.000 kroner. For selskaper og innretninger som nevnt i skatteloven § 2-36 annet ledd, er formuesskatten til staten 0,15 % av den formuen som overstiger 100.000 kroner."
        },
