          "nb" : "en av metodene for å unngå dobbeltbeskatning av en avgrensbar utenlandsinntekt for en fysisk person som innebærer at utenlandsinntekten blir skattlagt i Norge, men at skatten settes ned med den del av den norske skatten som faller på den inntekt som omfattes av metoden"
        },
        "remark" : {
          "nb" : "Dette gjelder for personer som er skattemessig bosatt i Norge etter intern rett og vedkommende skatteavtale. Metoden innebærer at Norge medregner inntekten i beskatningsgrunnlaget, men at skatten skal settes ned med den del av den norske skatten som faller på den inntekt som omfattes av den alternative fordelingsmetoden. Et eksempel er pensjonsinntekt som person som er bosatt i Norge mottar fra kilder i Australia. Skatteavtalen beskriver at Norge skal bruke den alternative fordelingsmetoden på denne utenlandsinntekten."
        },
