        "nb" : "Barnebidrag eller annen personlig understøttelse etter lov eller avtale; arbeidsavklaringspenger etter folketrygdloven; stønad, omsorgspenger og annen utbetaling fra omsorgs- og trygdeinnretning; uføretrygd etter folketrygdloven kapittel 12; uføreytelser fra andre ordninger enn folketrygden; overgangsstønad etter folketrygdloven §§ 15-7, 16-7 og 17-6; utdeling fra legat eller understøttelseforening; bidrag som etter konkursloven § 106 ytes konkursskyldner eller konkursskyldners familie under bobehandlingen; introduksjonsstønad beregnet etter lov om introduksjonsordning for nyankomne innvandrere kapittel 3; kvalifiseringsstønad etter lov om sosiale tjenester i arbeids- og velferdsforvaltningen; barnetrygd etter lov om barnetrygd; kontantstøtte etter kontantstøtteloven; bidrag til livsopphold etter lov om sosiale tjenester i arbeids- og velferdsforvaltningen; stønad ved helsetjenester etter folketrygdloven kapittel 5; grunnstønad og hjelpestønad etter  folketrygdloven kapittel 6; gravferdsstønad etter folketrygdloven § 7-2; stønad til bedring av funksjonsevnen i arbeidslivet  etter folketrygdloven § 10-5, jf. § 10-7; tilleggsstønader etter folketrygdloven § 11-12 til medlem i folketrygden som gjennomfører arbeidsrettet tiltak; engangsstønad ved fødsel eller adopsjon etter folketrygdloven § 14-17; stønad til barnetilsyn etter folketrygdloven §§  15-10, 17-9 og 17-10; tilleggsstønader og stønad til skolepenger mv. etter forlketrygdloven §§ 15-11, 16-9, 17-9 og 17-10; tillegg til hjelp i huset og hjelpeløshetsbidrag etter henholdsvis §§ 6 og 7 i lov om krigspensjonering for militærpersoner eller §§ 12 og 13 i lov om krigspensjonering for hjemmestyrkepersonell og sivilpersoner; husleiestøtte etter lov om bustøtte og kommunal bostøtte utenfor arbeidsforhold; invaliderenter etter lov om ulykkestrygding for fiskarar, lov om ulykkestrygd for industriarbeidere mv. og lov om ulykkestrygd for sjømenn, jf. §§ 53 og 54 i lov om yrkesskadetrygd; invaliderenter etter lov om ulykkestrygd for militærpersoner, jf lov av 9. juni 1961 om endring i lov om yrkesskadetrygd del II; invalidepensjon; særtilskudd etter barneloven kapittel 8; oppfostringsbidrag etter barnevernloven; bidragsforskudd etter forskotteringsloven; kompensasjonstillegg etter AFP-tilskottsloven § 9"
