      "example" : {
        "nb" : "A Holding AS framfører stort underskudd i alminnelig inntekt fra tidligere år. I skattleggingsperioden mottar A Holding AS aksjeutbytte fra et canadisk selskap.  Brutto utbytte utgjorde kr 1 000, men det var trukket 15 prosent inntektsskatt til canadiske myndigheter slik at A Holding AS mottok bare kr 850. Aksjeutbyttet er skattepliktig i Norge og A Holding AS krever i første omgang kreditfradrag for inntektsskatten betalt i Canada. Dette medfører at A Holding AS framfører kreditfradraget til seinere år fordi selskapet ikke betaler inntektsskatter i Norge som kreditfradraget kan avregnes mot. Skatteloven § 16-22 første ledd begrenser hvor lenge en kan framføre kreditfradrag. Litt før fristen for å endre skattemeldingen for formues- og inntektsskatt etter skatteforvaltningsloven § 9-4 utløper, innser A Holding AS at det ikke er sannsynlig at selskapet klarer å utnytte kreditfradraget innenfor femårsfristen. Selskapet bestemmer seg derfor å frafalle kravet om kreditfradrag. I stedet krever A Holding AS inntektsfradrag for skatten på kr 150 som er betalt til canadiske myndigheter. Dermed får A Holding AS et litt større underskudd i alminnelig inntekt. Det ikke er noen tidsbegrensning på hvor lenge selskapet kan framføre underskudd i alminnelig inntekt etter skatteloven § 6-3 fjerde ledd."
