        "text" : {
          "nb" : "oversikt over hendelser, som er resultat av en analyse for å avdekke og motvirke uberettiget innsyn i personopplysninger"
        },
        "remark" : {
          "nb" : "\"Innsynslogging er et kontrolltiltak i virksomheten\", og formålet er å motvirke uberettiget innsyn i personopplysninger av ansatte eller andre som utfører arbeid på vegne av virksomheten. Med uberettiget innsyn menes at vedkommende ser/gjør seg kjent med, eller har muligheten til å se/gjøre seg kjent med, data og informasjon som ikke er åpent tilgjengelig og som vedkommende ikke har tjenstlig behov for. Innsynslogging omfatter en sammenstilling av mange ulike typer logger. \"Disse dokumenterer blant annet vellykkede og mislykkede innloggingsforsøk, oppnådd adgang til filområder og andre hendelser i systemet\".\n\nResultatet av sammenstillingen vil være en oversikt over hendelser som må vurderes til å enten være berettiget innsyn eller uberettiget innsyn. Det er listen over uberettiget innsyn ved BR, den registrerte kan begjære innsyn i."
        },
