      "identifier" : "https://nav.no/begrep/Sindre_Spesial_7",
      "application" : [ ],
      "definition" : {
        "text" : {
          "nb" : "en kategori som beskriver behovet til brukere med varig nedsatt arbeidsevne, som ikke kan komme i ordinært arbeid gjennom en innsats fra NAV eller andre samarbeidende aktører. \n"
        },
        "remark" : {
          "nb" : "\"Varig tilpasset innsats tilbys brukere som etter en arbeidsevnevurdering har fått fastslått at arbeidsevnen er varig nedsatt, og at brukeren ikke vil kunne skaffe seg eller beholde ordinært arbeid gjennom en innsats fra NAV eller andre samarbeidende aktører.\" \n\n\"Det legges til grunn at utfallet varig tilpasset innsats kun i et fåtall tilfeller vil være utfallet etter en første arbeidsevnevurdering. Vanligvis kreves det at det er forsøkt ulike arbeidsrettede virkemidler og at dette utfallet derfor først er aktuelt når det er fastslått at ingen virkemidler anses å kunne føre fram til ordinært arbeid. Utfallet innebærer at innsatsen fra NAV kan omfatte både tidsbegrensede og varige aktiviteter og tjenester i tillegg til de generelle tjenestene. NAVs innsats vil ofte skje i kombinasjon med virkemidler fra andre, for eksempel medisinsk behandling og rehabilitering, sosial trening eller oppfølging. \n\nBrukeren har ikke rett til en aktivitetsplan, men bør kunne tilbys dette dersom det er hensiktsmessig eller dersom brukeren selv ønsker det.\" \n\n\"Vanligvis er uføretrygd den aktuelle ytelsen for brukeren med varig tilpasset innsats, men utfallet kan også omfatte brukere som ikke fyller vilkårene i folketrygdlovens kapittel 12 og derfor ikke vil ha rett til uføretrygd].\""
        },
        "source" : {
          "prefLabel" : {
            "nb" : "\"Varig tilpasset innsats\". I: Retningslinjer for oppfølgingsvedtak i NAV s. 6. Hentet 15. april 2016 fra https://navet.adeo.no/ansatt/Fag/Arbeid+og+aktivitet/Relatert+innhold/retningslinjer-14a; \nLOV-2006-06-16-20 Lov om arbeids- og velferdsforvaltningen (arbeids- og velferdsforvaltningsloven) NAV-loven] § 14a"
          }
        },
        "sources" : [ {
          "text" : {
            "nb" : "\"Varig tilpasset innsats\". I: Retningslinjer for oppfølgingsvedtak i NAV s. 6. Hentet 15. april 2016 fra https://navet.adeo.no/ansatt/Fag/Arbeid+og+aktivitet/Relatert+innhold/retningslinjer-14a; \nLOV-2006-06-16-20 Lov om arbeids- og velferdsforvaltningen (arbeids- og velferdsforvaltningsloven) NAV-loven] § 14a"
          }
        } ]
