      "prefLabel" : {
        "nb" : "samlet tap ved salg av fast eiendom"
      },
      "altLabel" : [ ],
      "hiddenLabel" : [ ],
      "contactPoint" : {
        "email" : "begrepskatalogen@skatteetaten.no"
      },
      "example" : {
        "nb" : "Bolig: Hvis du har solgt en bolig med gevinst/tap skal denne skattlegges/fradragsføres hvis du har: brukt den som egen bolig i mindre enn 12 av de siste 24 månedene (botid) og/eller eid boligen i under 1 år (eiertid) før salget eller avtalen om salg er inngått. Eiertiden regnes fra det tidspunktet du overtok boligen og frem til avtalen om salg (realisasjon) foreligger. Dersom det foreligger en såkalt brukshindring (f.eks. at du på grunn av arbeid eller sykdom er forhindret fra å oppfylle kravet om botid), kan du likevel få godkjent ikke-botid som botid i relasjon til skattereglene ved salg av bolig.  Fritidsbolig: Hvis du har solgt en fritidsbolig med gevinst/tap skal denne skattlegges/fradragsføres hvis du har: brukt den som egen fritidsbolig i mindre enn 5 av de siste 8 årene (botid) før salget og/eller eid fritidsboligen under 5 år (eiertid) før salget. Eiertiden regnes fra det tidspunktet du overtok eiendommen. Som hovedregel regnes du som eier fra det tidspunktet du overtok den faktiske rådigheten over fritidsboligen."
      },
